import React from 'react';
import { Container } from 'reactstrap';
import { Outlet } from 'react-router-dom';
import NavMenu from './NavMenu';

export default function Layout() {
  return (
    <div>
      <NavMenu />
      <Container className="mt-4">
        <Outlet />
      </Container>
    </div>
  );
}
